Data collection was based on an initial survey of all CFFA member facility operations for the reference year 2018. CFFA members operate 6 facilities in the USA and Canada producing various PVC roofing membranes. LCI data collection was based on one customized LCI survey for the CFFA SPPR PVC roofing membranes manufacturing facilities. The LCI survey covered the following primary data for each facility for the 2018 reference year:

- Total manufactured products, and co-products (by-products);

- Main unit processes;

- Excluded processes;

- Pollution abatement equipment;

- Raw materials;

- Secondary materials (if applicable);

- Pre- and post-consumer materials (if applicable);

- Ancillary materials;

- Packaging materials;  

- Electricity and fuel consumption;

- Water consumption (fresh and recycled);

- Inbound transportation distances and modes for all inputs;

- Emissions to air, water and land (if applicable);

- Solid waste;

- Wastewater and other liquid waste;

- Waste outputs and their respective outbound transportation distances and modes.
